import "./TitleHeader.scss";

export const TitleHeader = () => {
  return (
    <div className="header">
      <h1 className="title-logo">타이틀로고</h1>
      <p>동행복권 파워볼 기준으로 5분마다 추첨</p>
    </div>
  );
};
